// src/pages/Dashboard.js
import React from 'react';
import { Link } from 'react-router-dom';

function Dashboard() {
  return (
    <div>
      <h2>Employee Dashboard</h2>
      <nav>
        <Link to="/employ/request-question-bank">Request Question Bank</Link><br />
        <Link to="/self-assessment">Self Assessment</Link><br />
        <Link to="/submit-feedback">Submit Feedback</Link><br />
        <Link to="/learning-development">Learning and Development</Link><br />
        <Link to="/request-learning-plan">Request Learning Plan</Link><br />
        <Link to="/logout">Logout</Link>
      </nav>
    </div>
  );
}

export default Dashboard;
